sudo: required
language: python
python:
- '3.6'
services:
- docker
before_install:
- sudo apt-get install jq
- sudo apt-get remove python3-pip; sudo apt-get install python3-pip
- sudo pip3 install --upgrade awscli
- sudo pip3 install --upgrade awsebcli
- aws configure set aws_access_key_id $AWS_ACCESS_KEY_ID
- aws configure set aws_secret_access_key $AWS_SECRET_ACCESS_KEY
- aws configure set default.region $DEPLOYMENT_REGION
- aws configure set metadata_service_timeout 1200
- aws configure set metadata_service_num_attempts 3
before_script:
- echo 'Install dependencies in the app container'
script:
- echo 'Run unit tests in the app container'
after_success:
- if [ "${TRAVIS_PULL_REQUEST}" == "false" ] && [ "${TRAVIS_BRANCH}" == "${DEEP_BRANCH}" ];then ./deploy/deploy_to_eb.sh ; fi
